svg.script:
var Root=document.documentElement
var xmlns="http://www.w3.org/2000/svg"

function startup(evt){
	var A=getDisplaySize()
	var rightedge=A.width
	var bottomedge=A.height
	build(rightedge,bottomedge)
}
function build(w,h){
	var G=document.getElementById("G")
	var nwide=18
	var nhi=12
	for (i=0;i<1.1*nhi;i++){
		for (j=0;j<nwide*.6;j++){
			var R=document.createElementNS(xmlns, "rect")
			R.setAttributeNS(null, "height", h/nhi)
			R.setAttributeNS(null, "width", w/nwide)
			R.setAttributeNS(null, "y", 100+i*h/nhi)
			if (i%2==0) R.setAttributeNS(null, "x", j*w/nwide + 100)
			else R.setAttributeNS(null, "x", j*w/nwide - w/nwide/2 +100 )
			R.setAttributeNS(null, "stroke", "#888")
			R.setAttributeNS(null, "stroke-width", "2")
			var C = "rgb("+parseInt(Math.random()*255)+","+parseInt(Math.random()*255)+","+parseInt(Math.random()*255)+")";
			//var C="#820"
			R.setAttributeNS(null, "fill", C)	
			G.appendChild(R)
		}
	}
}
function button(evt){
	if(evt.type=="click")startup(evt)
}
function getDisplaySize()
{
//function due to G. Wade Johnson <svg-developers.yahoogroups.com>
//Date: Mon, 12 Dec 2005 20:57:49 -0600
//Subject: Re: [svg-developers] Screen extents
    var extents = null;
    try
    {
        var view = document.documentElement.viewport;
        extents = {
            width: view.width,
            height: view.height
        };
    }
    catch(e)
    {
        extents = {
            width: window.innerWidth,
            height: window.innerHeight
        };
    }
    return extents;
}

